import React, { useState } from 'react';
import { FileText } from 'lucide-react';
import { Button } from '@/components/ui/button';
import { Input } from '@/components/ui/input';
import { Textarea } from '@/components/ui/textarea';
import { Card, CardHeader, CardTitle, CardContent } from '@/components/ui/card';

const DetailedQuote = ({ quote }) => (
  <Card className="mt-6">
    <CardHeader>
      <CardTitle className="flex items-center">
        <FileText className="mr-2" />
        Detailed IT Service Quote
      </CardTitle>
    </CardHeader>
    <CardContent>
      <div className="space-y-4">
        <div>
          <h3 className="font-semibold">Issue Description</h3>
          <p>{quote.issueDescription}</p>
        </div>
        <div>
          <h3 className="font-semibold">Proposed Troubleshooting Steps</h3>
          <ul className="list-disc pl-5">
            {quote.troubleshootingSteps.map((step, index) => (
              <li key={index}>{step}</li>
            ))}
          </ul>
        </div>
        <div>
          <h3 className="font-semibold">Estimated Costs</h3>
          <p>Labor Rate: ${quote.laborRate}/hour</p>
          <p>Estimated Hours: {quote.estimatedHours}</p>
          <p className="font-bold">Total Estimated Cost: ${quote.totalCost}</p>
        </div>
        <div>
          <h3 className="font-semibold">Notes</h3>
          <p>{quote.notes}</p>
        </div>
      </div>
    </CardContent>
  </Card>
);

const QuotelessFrontend = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    description: ''
  });
  const [quote, setQuote] = useState(null);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const generateQuote = (description) => {
    // This function simulates the quote generation based on the description
    // In a real application, this would be handled by your AI model or backend service
    const laborRate = 75;
    let estimatedHours = 2;
    let troubleshootingSteps = [
      "Initial system diagnostic",
      "Check for software conflicts",
      "Verify hardware connections"
    ];
    let notes = "Additional hardware costs may apply depending on diagnostic results.";

    if (description.toLowerCase().includes("network")) {
      troubleshootingSteps.push("Network connectivity test", "Router/modem reset");
      estimatedHours = 3;
    } else if (description.toLowerCase().includes("software")) {
      troubleshootingSteps.push("Software reinstallation", "Data backup and recovery");
      estimatedHours = 4;
    } else if (description.toLowerCase().includes("hardware")) {
      troubleshootingSteps.push("Hardware component testing", "Potential part replacement");
      estimatedHours = 5;
      notes += " Parts cost will be quoted separately after initial diagnosis.";
    }

    return {
      issueDescription: description,
      troubleshootingSteps,
      laborRate,
      estimatedHours,
      totalCost: laborRate * estimatedHours,
      notes
    };
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const generatedQuote = generateQuote(formData.description);
    setQuote(generatedQuote);
  };

  return (
    <div className="max-w-2xl mx-auto mt-10 p-6 bg-white rounded-lg shadow-xl">
      <h1 className="text-2xl font-bold mb-6">Quoteless.ai - IT Support Quote</h1>
      <form onSubmit={handleSubmit}>
        <div className="space-y-4">
          <Input
            type="text"
            name="name"
            placeholder="Your Name"
            value={formData.name}
            onChange={handleInputChange}
            required
          />
          <Input
            type="email"
            name="email"
            placeholder="Email Address"
            value={formData.email}
            onChange={handleInputChange}
            required
          />
          <Input
            type="tel"
            name="phone"
            placeholder="Phone Number"
            value={formData.phone}
            onChange={handleInputChange}
            required
          />
          <Textarea
            name="description"
            placeholder="Describe your IT issue in detail"
            value={formData.description}
            onChange={handleInputChange}
            required
            rows={4}
          />
          <Button type="submit" className="w-full">Generate Quote</Button>
        </div>
      </form>
      {quote && <DetailedQuote quote={quote} />}
    </div>
  );
};

export default QuotelessFrontend;
